To create a Flappy Bird HTML demo, we need to use a combination of HTML, CSS, and JavaScript. We'll also use a library like p5.js or a game engine like Phaser for handling game logic and graphics. Here's a basic outline of how we can create a Flappy Bird game:

1. **HTML**: Set up the basic structure of the game, including a canvas element for rendering the game.
2. **CSS**: Style the game elements, such as the bird, pipes, and background.
3. **JavaScript**: Implement the game logic, including bird movement, collision detection, and game over conditions.

Since we're using a game engine like Phaser, we'll need to include the Phaser library in our HTML file. Here's how you can create a basic Flappy Bird game using Phaser:

```javascript
// Import Phaser
import Phaser from 'phaser';

// Define the game configuration
const config = {
  type: Phaser.AUTO,
  width: 800,
  height: 600,
  scene: {
    preload: preload,
    create: create,
    update: update
  }
};

// Create the game instance
const game = new Phaser.Game(config);

// Preload function to load assets
function preload() {
  this.load.image('bird', 'assets/bird.png');
  this.load.image('pipe', 'assets/pipe.png');
  this.load.image('background', 'assets/background.png');
}

// Create function to set up the game
function create() {
  // Create the background
  this.add.image(0, 0, 'background').setOrigin(0, 0);

  // Create the bird
  this.bird = this.physics.add.sprite(50, 275, 'bird').setBounce(1).setCollideWorldBounds(true);

  // Create the pipes
  this.pipes = this.physics.add.group();
  this.physics.add.collider(this.bird, this.pipes);

  // Add gravity to the bird
  this.physics.add.collider(this.bird, this.physics.world.bounds);
  this.bird.setVelocityY(-300);
}

// Update function to handle game logic
function update() {
  // Check for bird collision with pipes
  this.pipes.children.iterate(child => {
    if (child.y > 600) {
      child.destroy();
    }
  });

  // Move the pipes
  this.pipes.children.iterate(child => {
    child.x -= 200;
  });

  // Check for bird collision with ground
  if (this.bird.y > 600) {
    this.physics.pause();
    this.scene.stop();
  }
}
```

This code sets up a basic Flappy Bird game using Phaser. It includes loading assets, setting up the game scene, creating the bird and pipes, and handling game logic. Note that you need to have the assets (bird.png, pipe.png, background.png) in the 'assets' folder for this code to work.

